var title_f6_36_6723="PA pressure PDA Doppler echo-I";
var content_f6_36_6723=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F79806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F79806&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Echocardiography in a patient with patent ductus arteriosus and pulmonary arterial pressure calculation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 445px; height: 333px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The pulmonary arterial pressure in a patient with a patent ductus arteriosus can be calculated using the continuous wave Doppler tracing. The beam of the continuous wave Doppler interrogation (arrow) is directed into the jet of continuous left to right flow in the parasternal short axis view. A peak velocity (V) of 4 m/sec is noted by continuous wave Doppler. The peak gradient across the ductus is (V x 4)",
"    <sup>",
"     2",
"    </sup>",
"    , or 64mmHg. This, subtracted from the cuff systolic pressure of 96 mmHg, is consistent with an estimated pulmonary arterial systolic pressure of 32 mmHg.",
"    <div class=\"footnotes\">",
"     AO: aorta, PA: main pulmonary artery.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Thomas Doyle, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
