"      <i>",
"       Drugs",
"      </i>",
"      , 1997, 53(4):637-56.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?6/36/6724/abstract-text/9098664/pubmed\" id=\"9098664\" target=\"_blank\">",
"        9098664",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Shrestha N, Amuh D, Goldman MP, et al, &ldquo;Treatment of a Complicated Vancomycin-Resistant Enterococcal Urinary Tract Infection With Fosfomycin,&rdquo;",
"      <i>",
"       Infectious Diseases in Clinical Practice",
"      </i>",
"      , 2000, 9:368-71.",
