var title_f6_36_6734="ACEI vs Ca blocker in CRF";
var content_f6_36_6734=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F72717&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F72717&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    ACE inhibitor and calcium blocker therapy protect against progressive glomerulosclerosis in rats by different mechanisms",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 368px; height: 239px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Beneficial effect of antihypertensive therapy with the calcium channel blocker nifedipine and the angiotensin-converting enzyme inhibitor enalapril in rats with subtotal nephrectomy. At eight weeks, both drugs lowered the blood pressure to an equivalent degree and were associated with better maintenance of the glomerular filtration rate (GFR) and a lesser degree of glomerulosclerosis than untreated rats. However, the mechanism of protection appeared to be different: enalapril lowered the glomerular capillary pressure (PGC), while nifedipine minimized glomerular hypertrophy as manifested by a reduction in glomerular volume.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Dworkin LD, Burstein JA, Parker M, et al. Kidney Int 1993; 43:808.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
